import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <User name="Alexander Henao" />
      </header>
    </div>
  );
}

const User = props => {
  return (
    <div>
      <p>Hola {props.name}, bienvenido</p>
    </div>
  )
}
export default App;
